                _tagsAll = Output.All(value, emptySecret).Apply(v => v[0]);
            }
        }

        /// <summary>
        /// The type of launch.
        /// </summary>
        [Input("type")]
        public Input<string>? Type { get; set; }

        public LaunchState()
        {
        }
        public static new LaunchState Empty => new LaunchState();
    }
}
